import "./App.css";
import {
  BrowserRouter as Router,
  Route,
  Routes,
  Switch,
} from "react-router-dom";
import Login from "./pages/login/login";
import Disp from "./pages/login/disp";
import React from "react";
import { useNavigate } from "react-router-dom";

function App() {
  return (
    <Router>
      <Routes>
        <Route exact path="/login" element={<Login />} />
        <Route exact path="/Disp" element={() => <Disp authorised={false} />} />
      </Routes>
    </Router>
  );
}

export default App;
